     5→import { motion } from 'framer-motion';
     6→import {
     7→  ChevronLeft,
     8→  ChevronRight,
     9→  ZoomIn,
    10→  ZoomOut,
    11→  RotateCcw,
    12→  Check,
    13→  Circle,
    14→  Info,
