    18→import {
    19→  LandmarkPoint,
    20→  FRONT_PROFILE_LANDMARKS,
    21→  getLandmarkColor,
    22→  FRONT_LANDMARK_CATEGORIES,
    23→} from '@/lib/landmarks';
    24→import {
    25→  getLandmarkImageUrl,
    26→  getLandmarkPlacementGuide,
    27→  GUIDED_LANDMARK_ORDER,
