    29→
    30→interface GuidedLandmarkPlacementProps {
    31→  imageUrl: string;
    32→  initialLandmarks?: LandmarkPoint[];
    33→  onLandmarksChange?: (landmarks: LandmarkPoint[]) => void;
    34→  onComplete?: (landmarks: LandmarkPoint[]) => void;
    35→}
    36→
    37→export function GuidedLandmarkPlacement({
    38→  imageUrl,
    39→  initialLandmarks,
    40→  onLandmarksChange,
    41→  onComplete,
    42→}: GuidedLandmarkPlacementProps) {
    43→  const containerRef = useRef<HTMLDivElement>(null);
    44→  const [landmarks, setLandmarks] = useState<LandmarkPoint[]>(
    45→    initialLandmarks || FRONT_PROFILE_LANDMARKS
    46→  );
    47→  const [currentStepIndex, setCurrentStepIndex] = useState(0);
    48→  const [zoom, setZoom] = useState(1);
    49→  const [pan, setPan] = useState({ x: 0, y: 0 });
    50→  const [isDragging, setIsDragging] = useState(false);
    51→  const [showAllPoints, setShowAllPoints] = useState(false);
    52→  const [isFullscreen, setIsFullscreen] = useState(false);
    53→  const [referenceImageError, setReferenceImageError] = useState(false);
    54→
    55→  const currentLandmarkId = GUIDED_LANDMARK_ORDER[currentStepIndex];
    56→  const currentLandmark = landmarks.find((lm) => lm.id === currentLandmarkId);
    57→  const totalSteps = GUIDED_LANDMARK_ORDER.length;
    58→  const progress = ((currentStepIndex + 1) / totalSteps) * 100;
    59→
    60→  useEffect(() => {
    61→    onLandmarksChange?.(landmarks);
    62→  }, [landmarks, onLandmarksChange]);
    63→
    64→  useEffect(() => {
    65→    // Reset reference image error when step changes
    66→    setReferenceImageError(false);
    67→  }, [currentStepIndex]);
    68→
    69→  const updateLandmarkPosition = useCallback(
    70→    (x: number, y: number) => {
    71→      setLandmarks((prev) =>
    72→        prev.map((lm) =>
    73→          lm.id === currentLandmarkId ? { ...lm, x, y } : lm
    74→        )
    75→      );
    76→    },
    77→    [currentLandmarkId]
    78→  );
    79→
    80→  const handleContainerClick = useCallback(
    81→    (e: React.MouseEvent<HTMLDivElement>) => {
    82→      if (!containerRef.current || isDragging) return;
    83→
    84→      const rect = containerRef.current.getBoundingClientRect();
    85→      const rawX = (e.clientX - rect.left - rect.width / 2 - pan.x) / zoom + rect.width / 2;
    86→      const rawY = (e.clientY - rect.top - rect.height / 2 - pan.y) / zoom + rect.height / 2;
    87→
    88→      const x = Math.max(0, Math.min(1, rawX / rect.width));
    89→      const y = Math.max(0, Math.min(1, rawY / rect.height));
    90→
    91→      updateLandmarkPosition(x, y);
    92→    },
    93→    [isDragging, pan, zoom, updateLandmarkPosition]
    94→  );
    95→
    96→  const handleMouseDown = useCallback(
    97→    (e: React.MouseEvent) => {
    98→      if (e.button === 0 && zoom > 1) {
    99→        // Only allow panning when zoomed in
   100→        setIsDragging(true);
   101→      }
   102→    },
   103→    [zoom]
   104→  );
   105→
   106→  const handleMouseMove = useCallback(
   107→    (e: React.MouseEvent) => {
   108→      if (isDragging && zoom > 1) {
   109→        setPan((prev) => ({
   110→          x: prev.x + e.movementX,
   111→          y: prev.y + e.movementY,
   112→        }));
   113→      }
   114→    },
   115→    [isDragging, zoom]
   116→  );
   117→
   118→  const handleMouseUp = useCallback(() => {
   119→    setIsDragging(false);
   120→  }, []);
   121→
   122→  const handleZoomIn = () => {
   123→    setZoom((prev) => Math.min(prev + 0.5, 4));
   124→  };
   125→
   126→  const handleZoomOut = () => {
   127→    setZoom((prev) => {
   128→      const newZoom = Math.max(prev - 0.5, 1);
   129→      if (newZoom === 1) {
   130→        setPan({ x: 0, y: 0 });
   131→      }
   132→      return newZoom;
   133→    });
   134→  };
   135→
   136→  const handleResetZoom = () => {
   137→    setZoom(1);
   138→    setPan({ x: 0, y: 0 });
   139→  };
   140→
   141→  const handleNext = () => {
   142→    if (currentStepIndex < totalSteps - 1) {
   143→      setCurrentStepIndex((prev) => prev + 1);
   144→      handleResetZoom();
   145→    } else {
   146→      onComplete?.(landmarks);
   147→    }
   148→  };
   149→
   150→  const handlePrevious = () => {
   151→    if (currentStepIndex > 0) {
   152→      setCurrentStepIndex((prev) => prev - 1);
   153→      handleResetZoom();
   154→    }
   155→  };
   156→
   157→  const handleSkipToEnd = () => {
   158→    onComplete?.(landmarks);
   159→  };
   160→
   161→  const referenceImageUrl = currentLandmarkId
   162→    ? getLandmarkImageUrl(currentLandmarkId, 'male', 'white', 'infographic')
   163→    : null;
   164→
   165→  const placementGuide = currentLandmarkId
   166→    ? getLandmarkPlacementGuide(currentLandmarkId)
   167→    : '';
   168→
   169→  const color = currentLandmark
   170→    ? getLandmarkColor(currentLandmark.id, FRONT_LANDMARK_CATEGORIES)
   171→    : '#00f3ff';
   172→
   173→  return (
   174→    <div className="w-full max-w-6xl mx-auto">
   175→      {/* Progress Bar */}
   176→      <div className="mb-4">
   177→        <div className="flex items-center justify-between mb-2">
   178→          <span className="text-sm text-foreground-dim">
   179→            Step {currentStepIndex + 1} of {totalSteps}
   180→          </span>
   181→          <span className="text-sm text-foreground-dim">
   182→            {Math.round(progress)}% Complete
   183→          </span>
   184→        </div>
   185→        <div className="h-2 bg-background-tertiary rounded-full overflow-hidden">
   186→          <motion.div
   187→            className="h-full bg-accent"
   188→            initial={{ width: 0 }}
   189→            animate={{ width: `${progress}%` }}
   190→            transition={{ duration: 0.3 }}
   191→          />
   192→        </div>
   193→      </div>
   194→
   195→      {/* Main Content Grid */}
   196→      <div className="grid lg:grid-cols-3 gap-6">
   197→        {/* Left Panel - Reference Image and Instructions */}
   198→        <div className="lg:col-span-1 space-y-4">
   199→          {/* Current Landmark Info Card */}
   200→          <motion.div
   201→            key={currentLandmarkId}
   202→            initial={{ opacity: 0, y: 10 }}
   203→            animate={{ opacity: 1, y: 0 }}
   204→            className="bg-background-secondary rounded-xl border border-border p-4"
   205→          >
   206→            <div className="flex items-center gap-3 mb-3">
   207→              <div
   208→                className="w-4 h-4 rounded-full border-2 border-white"
   209→                style={{ backgroundColor: color }}
   210→              />
   211→              <div>
   212→                <h3 className="text-lg font-semibold text-white">
   213→                  {currentLandmark?.label}
   214→                </h3>
   215→                <p className="text-xs text-accent">{currentLandmark?.medicalTerm}</p>
   216→              </div>
   217→            </div>
   218→
   219→            <div className="flex items-start gap-2 text-sm text-foreground-dim">
   220→              <Info className="w-4 h-4 mt-0.5 flex-shrink-0" />
   221→              <p>{currentLandmark?.description}</p>
   222→            </div>
   223→          </motion.div>
   224→
   225→          {/* Reference Image */}
   226→          <motion.div
   227→            key={`ref-${currentLandmarkId}`}
   228→            initial={{ opacity: 0, scale: 0.95 }}
   229→            animate={{ opacity: 1, scale: 1 }}
   230→            className="bg-background-secondary rounded-xl border border-border overflow-hidden"
   231→          >
   232→            <div className="p-3 border-b border-border">
   233→              <h4 className="text-sm font-medium text-white flex items-center gap-2">
   234→                <Circle className="w-3 h-3" style={{ fill: color, color: color }} />
   235→                Reference Guide
   236→              </h4>
   237→            </div>
   238→            <div className="relative aspect-square bg-black/50">
   239→              {referenceImageUrl && !referenceImageError ? (
   240→                <Image
   241→                  src={referenceImageUrl}
   242→                  alt={`Reference for ${currentLandmark?.label}`}
   243→                  fill
   244→                  className="object-contain p-4"
   245→                  unoptimized
   246→                  onError={() => setReferenceImageError(true)}
   247→                />
   248→              ) : (
   249→                <div className="absolute inset-0 flex items-center justify-center p-4 text-center">
   250→                  <div>
   251→                    <div
   252→                      className="w-16 h-16 rounded-full mx-auto mb-3 border-4 border-dashed flex items-center justify-center"
   253→                      style={{ borderColor: color }}
   254→                    >
   255→                      <Circle className="w-6 h-6" style={{ color: color }} />
   256→                    </div>
   257→                    <p className="text-foreground-dim text-sm">{placementGuide}</p>
   258→                  </div>
   259→                </div>
   260→              )}
   261→            </div>
   262→          </motion.div>
   263→
   264→          {/* Placement Guide Text */}
   265→          <div className="bg-accent/10 rounded-xl border border-accent/30 p-4">
   266→            <p className="text-sm text-accent">{placementGuide}</p>
   267→          </div>
   268→
   269→          {/* Quick Actions */}
   270→          <div className="flex gap-2">
   271→            <button
   272→              onClick={() => setShowAllPoints(!showAllPoints)}
   273→              className={`flex-1 py-2 px-3 rounded-lg text-sm font-medium transition-colors ${
   274→                showAllPoints
   275→                  ? 'bg-accent text-black'
   276→                  : 'bg-white/10 text-foreground-dim hover:bg-white/20'
   277→              }`}
   278→            >
   279→              {showAllPoints ? 'Hide Other Points' : 'Show All Points'}
   280→            </button>
   281→            <button
   282→              onClick={handleSkipToEnd}
   283→              className="py-2 px-4 rounded-lg text-sm font-medium bg-white/10 text-foreground-dim hover:bg-white/20 transition-colors"
   284→            >
   285→              Skip to End
   286→            </button>
   287→          </div>
   288→        </div>
   289→
   290→        {/* Right Panel - Image Canvas */}
   291→        <div className="lg:col-span-2">
   292→          {/* Zoom Controls */}
   293→          <div className="flex items-center justify-between mb-3">
   294→            <div className="flex items-center gap-2">
   295→              <button
   296→                onClick={handleZoomOut}
   297→                disabled={zoom <= 1}
   298→                className="p-2 rounded-lg bg-white/10 text-white hover:bg-white/20 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
   299→              >
   300→                <ZoomOut className="w-5 h-5" />
   301→              </button>
   302→              <span className="text-sm text-foreground-dim min-w-[4rem] text-center">
   303→                {Math.round(zoom * 100)}%
   304→              </span>
   305→              <button
   306→                onClick={handleZoomIn}
   307→                disabled={zoom >= 4}
   308→                className="p-2 rounded-lg bg-white/10 text-white hover:bg-white/20 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
   309→              >
   310→                <ZoomIn className="w-5 h-5" />
   311→              </button>
   312→              <button
   313→                onClick={handleResetZoom}
   314→                disabled={zoom === 1}
   315→                className="p-2 rounded-lg bg-white/10 text-white hover:bg-white/20 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
   316→              >
   317→                <RotateCcw className="w-5 h-5" />
   318→              </button>
   319→            </div>
   320→
   321→            <button
   322→              onClick={() => setIsFullscreen(!isFullscreen)}
   323→              className="p-2 rounded-lg bg-white/10 text-white hover:bg-white/20 transition-colors"
   324→            >
   325→              {isFullscreen ? (
   326→                <Minimize2 className="w-5 h-5" />
   327→              ) : (
   328→                <Maximize2 className="w-5 h-5" />
   329→              )}
   330→            </button>
   331→          </div>
   332→
   333→          {/* Image Canvas */}
   334→          <motion.div
   335→            layout
   336→            className={`relative rounded-2xl overflow-hidden bg-black border border-border ${
   337→              isFullscreen ? 'fixed inset-4 z-50' : 'aspect-[3/4]'
   338→            }`}
   339→          >
   340→            {/* Fullscreen overlay background */}
   341→            {isFullscreen && (
   342→              <div
   343→                className="fixed inset-0 bg-black/90 -z-10"
   344→                onClick={() => setIsFullscreen(false)}
   345→              />
   346→            )}
   347→
   348→            <div
   349→              ref={containerRef}
   350→              className="absolute inset-0 cursor-crosshair overflow-hidden"
   351→              onClick={handleContainerClick}
   352→              onMouseDown={handleMouseDown}
   353→              onMouseMove={handleMouseMove}
   354→              onMouseUp={handleMouseUp}
   355→              onMouseLeave={handleMouseUp}
   356→              style={{
   357→                cursor: zoom > 1 && isDragging ? 'grabbing' : zoom > 1 ? 'grab' : 'crosshair',
   358→              }}
   359→            >
   360→              {/* Transformed Image Container */}
   361→              <div
   362→                className="absolute inset-0 transition-transform duration-100"
   363→                style={{
   364→                  transform: `scale(${zoom}) translate(${pan.x / zoom}px, ${pan.y / zoom}px)`,
   365→                  transformOrigin: 'center center',
   366→                }}
   367→              >
   368→                {/* User's Image */}
   369→                <Image
   370→                  src={imageUrl}
   371→                  alt="Your photo"
   372→                  fill
   373→                  className="object-contain pointer-events-none select-none"
   374→                  unoptimized
   375→                  draggable={false}
   376→                />
   377→
   378→                {/* All Landmarks (dimmed) */}
   379→                {showAllPoints &&
   380→                  landmarks.map((landmark) => {
   381→                    if (landmark.id === currentLandmarkId) return null;
   382→                    const lmColor = getLandmarkColor(landmark.id, FRONT_LANDMARK_CATEGORIES);
   383→                    return (
   384→                      <div
   385→                        key={landmark.id}
   386→                        className="absolute w-3 h-3 -translate-x-1/2 -translate-y-1/2 pointer-events-none"
   387→                        style={{
   388→                          left: `${landmark.x * 100}%`,
   389→                          top: `${landmark.y * 100}%`,
   390→                          opacity: 0.3,
   391→                        }}
   392→                      >
   393→                        <div
   394→                          className="w-full h-full rounded-full border border-white/50"
   395→                          style={{ backgroundColor: lmColor }}
   396→                        />
   397→                      </div>
   398→                    );
   399→                  })}
   400→
   401→                {/* Current Landmark (highlighted) */}
   402→                {currentLandmark && (
   403→                  <motion.div
   404→                    key={currentLandmarkId}
   405→                    initial={{ scale: 0 }}
   406→                    animate={{ scale: 1 }}
   407→                    className="absolute w-6 h-6 -translate-x-1/2 -translate-y-1/2 z-20"
   408→                    style={{
   409→                      left: `${currentLandmark.x * 100}%`,
   410→                      top: `${currentLandmark.y * 100}%`,
   411→                    }}
   412→                  >
   413→                    {/* Pulsing ring */}
   414→                    <motion.div
   415→                      className="absolute inset-0 rounded-full"
   416→                      style={{ borderColor: color }}
   417→                      animate={{
   418→                        scale: [1, 1.5, 1],
   419→                        opacity: [0.8, 0, 0.8],
   420→                      }}
   421→                      transition={{
   422→                        duration: 2,
   423→                        repeat: Infinity,
   424→                        ease: 'easeInOut',
   425→                      }}
   426→                    >
   427→                      <div
   428→                        className="w-full h-full rounded-full border-2"
   429→                        style={{ borderColor: color }}
   430→                      />
   431→                    </motion.div>
   432→
   433→                    {/* Main dot */}
   434→                    <div
   435→                      className="absolute inset-1 rounded-full border-2 border-white shadow-lg"
   436→                      style={{
   437→                        backgroundColor: color,
   438→                        boxShadow: `0 0 20px ${color}`,
   439→                      }}
   440→                    />
   441→
   442→                    {/* Crosshair */}
   443→                    <div className="absolute inset-0 flex items-center justify-center pointer-events-none">
   444→                      <div
   445→                        className="absolute w-8 h-[2px] -translate-x-1/2 left-1/2"
   446→                        style={{ backgroundColor: `${color}80` }}
   447→                      />
   448→                      <div
   449→                        className="absolute h-8 w-[2px] -translate-y-1/2 top-1/2"
   450→                        style={{ backgroundColor: `${color}80` }}
   451→                      />
   452→                    </div>
   453→                  </motion.div>
   454→                )}
   455→              </div>
   456→
   457→              {/* Zoom indicator in corner */}
   458→              {zoom > 1 && (
   459→                <div className="absolute top-3 left-3 px-2 py-1 rounded bg-black/70 text-white text-xs">
   460→                  {Math.round(zoom * 100)}% - Drag to pan
   461→                </div>
   462→              )}
   463→            </div>
   464→
   465→            {/* Instructions overlay */}
   466→            <div className="absolute bottom-0 left-0 right-0 bg-gradient-to-t from-black/80 to-transparent p-4">
   467→              <p className="text-center text-white text-sm">
   468→                Click on the image to place the{' '}
   469→                <span style={{ color: color }}>{currentLandmark?.label}</span> landmark
   470→              </p>
   471→            </div>
   472→          </motion.div>
   473→
   474→          {/* Navigation Buttons */}
   475→          <div className="flex items-center justify-between mt-4">
   476→            <button
   477→              onClick={handlePrevious}
   478→              disabled={currentStepIndex === 0}
   479→              className="flex items-center gap-2 px-4 py-3 rounded-lg bg-white/10 text-white hover:bg-white/20 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
   480→            >
   481→              <ChevronLeft className="w-5 h-5" />
   482→              Previous
   483→            </button>
   484→
   485→            <div className="flex items-center gap-1">
   486→              {/* Step indicators - show subset around current */}
   487→              {Array.from({ length: Math.min(7, totalSteps) }).map((_, i) => {
   488→                let stepIndex: number;
   489→                if (totalSteps <= 7) {
   490→                  stepIndex = i;
   491→                } else if (currentStepIndex < 3) {
   492→                  stepIndex = i;
   493→                } else if (currentStepIndex > totalSteps - 4) {
   494→                  stepIndex = totalSteps - 7 + i;
   495→                } else {
   496→                  stepIndex = currentStepIndex - 3 + i;
   497→                }
   498→
   499→                const isCompleted = stepIndex < currentStepIndex;
   500→                const isCurrent = stepIndex === currentStepIndex;
   501→
   502→                return (
   503→                  <button
   504→                    key={stepIndex}
   505→                    onClick={() => {
   506→                      setCurrentStepIndex(stepIndex);
   507→                      handleResetZoom();
   508→                    }}
   509→                    className={`w-2 h-2 rounded-full transition-all ${
   510→                      isCurrent
   511→                        ? 'w-6 bg-accent'
   512→                        : isCompleted
   513→                          ? 'bg-green-500'
   514→                          : 'bg-white/20'
   515→                    }`}
   516→                  />
   517→                );
   518→              })}
   519→            </div>
   520→
   521→            <button
   522→              onClick={handleNext}
   523→              className="flex items-center gap-2 px-6 py-3 rounded-lg bg-accent text-black font-semibold hover:shadow-[0_0_20px_rgba(0,243,255,0.5)] transition-all"
   524→            >
   525→              {currentStepIndex === totalSteps - 1 ? (
   526→                <>
   527→                  <Check className="w-5 h-5" />
   528→                  Complete
   529→                </>
   530→              ) : (
   531→                <>
   532→                  Next
   533→                  <ChevronRight className="w-5 h-5" />
   534→                </>
   535→              )}
   536→            </button>
   537→          </div>
   538→        </div>
   539→      </div>
   540→    </div>
