const handleZoomIn = () => {
  setZoomLevel((prev) => Math.min(prev + 1, 3) as 1 | 2 | 3);
};

const handleZoomOut = () => {
  setZoomLevel((prev) => {
    const newLevel = Math.max(prev - 1, 1) as 1 | 2 | 3;
    if (newLevel === 1) {
      setPan({ x: 0, y: 0 });
    }
    return newLevel;
  });
};

const handleResetZoom = () => {
  setZoomLevel(1);
  setPan({ x: 0, y: 0 });
};

const handleSetZoomLevel = (level: 1 | 2 | 3) => {
  setZoomLevel(level);
  if (level === 1) {
    setPan({ x: 0, y: 0 });
  }
};

// Arrow key movement for fine landmark adjustment
const moveLandmark = useCallback((direction: 'up' | 'down' | 'left' | 'right') => {
  const step = 0.002; // Small step for fine adjustment
  setLandmarks((prev) =>
    prev.map((lm) => {
      if (lm.id !== currentLandmarkId) return lm;
      let newX = lm.x;
      let newY = lm.y;
      switch (direction) {
        case 'up': newY = Math.max(0, lm.y - step); break;
        case 'down': newY = Math.min(1, lm.y + step); break;
        case 'left': newX = Math.max(0, lm.x - step); break;
        case 'right': newX = Math.min(1, lm.x + step); break;
      }
      return { ...lm, x: newX, y: newY };
    })
  );
}, [currentLandmarkId]);

// Keyboard event handler
useEffect(() => {
  const handleKeyDown = (e: KeyboardEvent) => {
    // Prevent default for our shortcuts
    if (['ArrowUp', 'ArrowDown', 'ArrowLeft', 'ArrowRight', 'Enter', 'Backspace', 'r', 'R', '1', '2', '3'].includes(e.key)) {
      e.preventDefault();
    }

    setPressedKey(e.key);

    switch (e.key) {
      case 'ArrowUp':
        moveLandmark('up');
        break;
      case 'ArrowDown':
        moveLandmark('down');
        break;
      case 'ArrowLeft':
        moveLandmark('left');
        break;
      case 'ArrowRight':
        moveLandmark('right');
        break;
      case 'Enter':
        handleNext();
        break;
      case 'Backspace':
        handlePrevious();
        break;
      case 'r':
      case 'R':
        handleResetZoom();
        break;
      case '1':
        handleSetZoomLevel(1);
        break;
      case '2':
        handleSetZoomLevel(2);
        break;
      case '3':
        handleSetZoomLevel(3);
        break;
    }
  };

  const handleKeyUp = () => {
    setPressedKey(null);
  };

  window.addEventListener('keydown', handleKeyDown);
  window.addEventListener('keyup', handleKeyUp);
  return () => {
    window.removeEventListener('keydown', handleKeyDown);
    window.removeEventListener('keyup', handleKeyUp);
  };
}, [moveLandmark, currentStepIndex, totalSteps]);

