                        key={landmark.id}
                        className="absolute w-3 h-3 -translate-x-1/2 -translate-y-1/2 pointer-events-none"
                        style={{
                          left: `${landmark.x * 100}%`,
                          top: `${landmark.y * 100}%`,
                          opacity: 0.3,
