  onComplete?.(landmarks);
}, [landmarks, onComplete]);

// Keyboard event handler
useEffect(() => {
  const handleKeyDown = (e: KeyboardEvent) => {
    // Prevent default for our shortcuts
    if (['ArrowUp', 'ArrowDown', 'ArrowLeft', 'ArrowRight', 'Enter', 'Backspace', 'r', 'R', '1', '2', '3'].includes(e.key)) {
      e.preventDefault();
    }

    setPressedKey(e.key);

    switch (e.key) {
      case 'ArrowUp':
        moveLandmark('up');
        break;
      case 'ArrowDown':
        moveLandmark('down');
        break;
      case 'ArrowLeft':
        moveLandmark('left');
        break;
      case 'ArrowRight':
        moveLandmark('right');
        break;
      case 'Enter':
        handleNext();
        break;
      case 'Backspace':
        handlePrevious();
        break;
      case 'r':
      case 'R':
        handleResetZoom();
        break;
      case '1':
        handleSetZoomLevel(1);
        break;
      case '2':
        handleSetZoomLevel(2);
        break;
      case '3':
        handleSetZoomLevel(3);
        break;
    }
  };

  const handleKeyUp = () => {
    setPressedKey(null);
  };

  window.addEventListener('keydown', handleKeyDown);
  window.addEventListener('keyup', handleKeyUp);
  return () => {
    window.removeEventListener('keydown', handleKeyDown);
    window.removeEventListener('keyup', handleKeyUp);
  };
}, [moveLandmark, handleNext, handlePrevious, handleSetZoomLevel]);

